import { Switch, Route, Redirect } from "react-router-dom";
import { pageRoutes } from "constants/pageRoutes";
import Main from "pages/Main/Main";

function AppRouter() {
	return (
		<Switch>
			<Route exact path={pageRoutes.MAIN_PAGE}>
				<Main />
			</Route>
		</Switch>
	);
}

export default AppRouter;
